E_D("replace into `phome_ecms_game` values('714','5','0','','','','1','admin','','1','0','1343189541','0','0','0','0','','','714','0','0','0','0','0','0','小飞侠','1343189541','/spic/20120725/398.jpg','0','1','1343189541','0','3','1','0','','0','','','667','479','彼得·潘是一个不愿意长大、热爱飞翔的男孩，伦敦小女孩温蒂作梦也没想到小飞侠彼得·潘会真的出现在她眼前，并且邀请她到梦幻仙岛玩。温蒂带上她的两个弟弟，和彼得·潘一起开始了冒险之旅。梦幻岛有美丽的人鱼、豪爽的印第安酋长和公主莉莉……但是彼得·潘的死对头，可恶的海盗铁钩船长老是捣蛋，小飞侠跟铁钩船长的斗争充满了童趣和惊险。到底在梦幻仙岛上会有什么意想不到的事发生呢？','1','','0','','1','/dpic/20120725/399.jpg','140','/donghuapian/140/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/130.jpg','http://www.61baobao.com/donghuapian/pic/130.jpg','0','三个月以上','1','sohu,4382|||','0','','0','0','0');");
