E_D("replace into `phome_ecms_game` values('723','5','0','','','','1','admin','','1','0','1343189577','0','0','0','0','','','723','0','0','0','0','0','0','邋遢大王奇遇记','1343189577','/spic/20120725/418.jpg','0','1','1343189577','0','3','1','0','','0','','','667','479','一个小男孩外号叫邋遢大王。他不讲卫生，乱扔废物，脏东西也照吃不误。老鼠王国的密探尖嘴鼠看中了他，在橘子水里投下药丸，邋遢大王喝了以后，一下子变成与老鼠一般大的小人。他跟着尖嘴鼠来到老鼠王国。他不愿呆在那里，几次逃跑，无奈老鼠王国兵将众多，最后还是被关了起来。原来鼠王想要称霸地球，征服人类。小邋遢就是他们作为研究消灭人类的“秘密细菌“的实验品。小邋遢决心逃出监牢，把“秘密细菌”的事报告地面上的人们。在善良的小白鼠的帮助下，他几经周折与磨难，终于找到了秘密地图。不料又一次被鼠王布下的埋伏捉住了，可怜的小白鼠也被推下了万丈深谷。鼠国博士高兴地在邋遢大王身上做实验，由于忠实的小猫、小狗早已偷换了药品，鼠国博士以失败告终。鼠王咆哮着要杀小邋遢，正巧鼠国公主即将出嫁。公主要利用邋遢大王的才能为自己操办像人间一样的婚事。小邋遢巧妙地用爆竹替代礼花，把老鼠王国炸塌了。他带着共患难的小猫、小狗回到了地面。邋遢大王尝到了邋遢的苦果，从此再也不邋遢了。','1','','0','','1','/dpic/20120725/421.jpg','226','/donghuapian/226/1.html, /donghuapian/226/2.html, /donghuapian/226/3.html, /donghuapian/226/4.html, /donghuapian/226/5.html, /donghuapian/226/6.html, /donghuapian/226/7.html, /donghuapian/226/8.html, /donghuapian/226/9.html, /donghuapian/226/10.html, /donghuapian/226/11.html, /donghuapian/226/12.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/06/043.jpg','http://www.61baobao.com/donghuapian/pic/06/043.jpg','0','三个月以上','12','0,http://you.video.sina.com.cn/api/sinawebApi/outplayrefer.php/vid=18548623_1267581444_O03gSCduBjbK+l1lHz2stqkP7KQNt6nki2yzvlqlIQpdQ0/XM5GYatgD6C/UA9kEqDhARZA6cfYg1R4/s.swf|||0,http://you.video.sina.com.cn/api/sinawebApi/outplayrefer.php/vid=19622525_1591065853_OkvjTXYwBjbK+l1lHz2stqkP7KQNt6nkjGO1u1ShLQtaQ0/XM5GYa9sF4izUBdkEqDhARZE5d/wj1Rg/s.swf|||0,http://you.video.sina.com.cn/api/sinawebApi/outplayrefer.php/vid=10355908_1321776037_Z0jnTXdqBjLK+l1lHz2stqkP7KQNt6nkimi1vFWiJQ1eQ0/XM5GYYt4C5SDWCNkEqDhARZg8cPsv1xU/s.swf|||0,http://you.video.sina.com.cn/api/sinawebApi/outplayrefer.php/vid=19623427_1591065853_b0OxSSZsWWDK+l1lHz2stqkP7KQNt6nkjGO1u1ShLQtaQ0/XM5GYa9sF4y3UB9kEqDhARZE5d/0i1Ro/s.swf|||0,http://you.video.sina.com.cn/api/sinawebApi/outplayrefer.php/vid=19632176_1591065853_O0myHXRtDWbK+l1lHz2stqkP7KQNt6nkjGO