E_D("replace into `phome_ecms_game` values('734','5','2','','','','1','admin','','1','0','1343189621','0','0','0','2','','','734','0','0','0','0','0','0','哈皮父子之超能泡蛋','1343189621','/spic/20120725/450.jpg','0','1','1343189621','0','3','1','0','','0','','','667','479','大哈小皮这一对连打喷嚏的声音都是“Hapiu！”的快乐易拉罐父子，在第一部的52集里经历了果园老家和垃圾海岛的闯荡，在第二部52集里回到了都市里生活。哈皮父子生活的地方，是一座像超市一样琳琅满目的超级大都市。购物架状的哈皮公寓，贩卖机状的饮料能源公司，还有保鲜医院、泡泡小学、吸管游乐园等等。哈爸爸是能源公司专门生产“超级能源饮料”的小职员，这种能产生隐身、飞翔、变形等很多特殊功能的神奇饮料，给父子俩和超市城公民们的生活带来了便利与快乐，也带来了不少麻烦。皮儿子在泡泡小学读书，他和身边的形态不同、性格各异的小伙伴们发生了很多意想不到的趣事，加上各自同样有趣的父母们时不时地掺合，也给父子俩的生活带来了哭笑不得的影响…… ','1','','0','','1','/dpic/20120725/451.jpg','581','/donghuapian/581/1.html, /donghuapian/581/2.html, /donghuapian/581/3.html, /donghuapian/581/4.html, /donghuapian/581/5.html, /donghuapian/581/6.html, /donghuapian/581/7.html, /donghuapian/581/8.html, /donghuapian/581/9.html, /donghuapian/581/10.html, /donghuapian/581/11.html, /donghuapian/581/12.html, /donghuapian/581/13.html, /donghuapian/581/14.html, /donghuapian/581/15.html, /donghuapian/581/16.html, /donghuapian/581/17.html, /donghuapian/581/18.html, /donghuapian/581/19.html, /donghuapian/581/20.html, /donghuapian/581/21.html, /donghuapian/581/22.html, /donghuapian/581/23.html, /donghuapian/581/24.html, /donghuapian/581/25.html, /donghuapian/581/26.html, /donghuapian/581/27.html, /donghuapian/581/28.html, /donghuapian/581/29.html, /donghuapian/581/30.html, /donghuapian/581/31.html, /donghuapian/581/32.html, /donghuapian/581/33.html, /donghuapian/581/34.html, /donghuapian/581/35.html, /donghuapian/581/36.html, /donghuapian/581/37.html, /donghuapian/581/38.html, /donghuapian/581/39.html, /donghuapian/581/40.html, /donghuapian/581/41.html, /donghuapian/581/42.html, /donghuapian/581/43.html, /donghuapian/581/44.html, /donghuapian/581/45.html, /donghuapian/581/46.html, /donghuapian/581/47.html, /donghuapian/581/48.html, /donghuapian/581/49.html, /donghuapian/581/50.html, /donghuapian/581/51.html, /donghuapian/581/52.html, /donghuapian/581/53.html, 