E_D("replace into `phome_ecms_game` values('743','5','0','','','','1','admin','','1','0','1343189652','0','0','0','0','','','743','0','0','0','0','0','0','小小探索家','1343189652','/spic/20120725/470.jpg','0','1','1343189652','0','3','1','0','','0','','','667','479','“小小探索家”是全球知名婴幼儿品牌“费雪”旗下首推学前动画片，被翻译成多种语言在全球40多个国家播放。“小小探索家”的故事启发了全世界无数小朋友的心灵和想象力。在简单有趣的故事中，学习形状、数字、颜色等基本知识，并学会如何交朋友，互帮互助等朋友之间的相处之道，从小培养孩子的情商。','1','','0','','1','/dpic/20120725/471.jpg','608','/donghuapian/608/1.html, /donghuapian/608/2.html, /donghuapian/608/3.html, /donghuapian/608/4.html, /donghuapian/608/5.html, /donghuapian/608/6.html, /donghuapian/608/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0222.jpg','http://www.61baobao.com/donghuapian/pic/05/0222.jpg','0','三个月以上','7','qiyi,17367860f0f540978e63480a2487cbd8|||qiyi,8d9f94b283fa4ac4ac7f3c8f6b2b5f91|||qiyi,fbff748ad6954fdc85219298cb2454b0|||qiyi,f09f75adc2b2401ea55ae96d9155919b|||qiyi,df28489ba6784a2388f01c340c2a944c|||qiyi,51c7cbb70711432c862bc21265fa995f|||qiyi,0258c4f5dc2348d9ab7fe16912754def|||','0','','0','0','0');");
