E_D("replace into `phome_ecms_game` values('763','5','0','','','','1','admin','','1','0','1343189688','0','0','0','1','','','763','0','0','0','0','0','0','梦幻镇3','1343189688','/spic/20120725/514.jpg','0','1','1343189688','0','3','1','0','','0','','','667','479','这是一个充满情感、温馨、甜美为主基调的抒情系列，但细节却不乏幽默。故事的主题均为情感教育、美感教育和道德教育为主。适龄对象是学龄前幼儿和小学低年级。在美丽的梦幻镇，主人公咪咪鼠和豆豆鼠是一对好朋友，但他们也常常会发生一些小矛盾，或者，他们会为达到一个理想化的目的而共同去做一件事，故事因此而展开，而会一点魔法的鼠阿大往往是他们的对立面。其他的人物如青蛙先生和蛤蟆小姐、恐龙饭饭和英雄虎哥，以及特殊人物大嘴鸦都为故事的表现增添了活跃而温情、幽默的气氛，使故事充满优美想象和抒情风格。','1','','0','','1','/dpic/20120725/515.jpg','615','/donghuapian/615/1.html, /donghuapian/615/2.html, /donghuapian/615/3.html, /donghuapian/615/4.html, /donghuapian/615/5.html, /donghuapian/615/6.html, /donghuapian/615/7.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0229.jpg','http://www.61baobao.com/donghuapian/pic/05/0229.jpg','0','三个月以上','7','qiyi,15d18844fe8511dfaa6aa4badb2c35a1|||qiyi,15d19186fe8511dfaa6aa4badb2c35a1|||qiyi,15d193defe8511dfaa6aa4badb2c35a1|||qiyi,15d19a64fe8511dfaa6aa4badb2c35a1|||qiyi,15d19f28fe8511dfaa6aa4badb2c35a1|||qiyi,15d1a70cfe8511dfaa6aa4badb2c35a1|||qiyi,15d1b4fefe8511dfaa6aa4badb2c35a1|||','0','','0','0','0');");
