E_D("replace into `phome_ecms_game` values('767','5','0','','','','1','admin','','1','0','1343189691','0','0','0','0','','','767','0','0','0','0','0','0','大嘴巴嘟嘟','1343189691','/spic/20120725/518.jpg','0','1','1343189691','0','3','1','0','','0','','','667','479','本剧以一位五岁的天真无虑的幼儿园小朋友大嘴巴嘟嘟为主人翁，他聪明“绝顶”，富于幻想、语出惊人。在常人眼里看似普通的事情，他却能问出你意想不到，同时又让你捧腹大笑的问题。他还有着超级的模仿能力。在幼儿园里有一个勤学善问、智商超出一般小孩子的小大人——铛铛，他学习成绩好、聪明、高傲，深受老师和同学们的喜爱，再加上小恩、阿鱼、阿威，当这几个天真无邪，善良，勇敢，富有正义感的小朋友聚在一起的时候，一系列充满童趣而精彩的故事，就上演了。所有的故事都贴近小孩子的生活圈子，是每个小朋友在生活中都有可能遇到的事情。大嘴巴嘟嘟和朋友们用他们自己的方式一起去解决问题而引发了一系列故事。通过观看故事，小朋友们不仅仅可以了解一系列与自然科学有关的知识，同时还能培养小朋友们的逻辑思维能力，并且教导小朋友在日常生活中要多培养良好的行为习惯及思想品德，还要学习在生活中的自我保护，养成自己发现问题并解决问题的好习惯。','1','','0','','1','/dpic/20120725/519.jpg','555','/donghuapian/555/1.html, /donghuapian/555/2.html, /donghuapian/555/3.html, /donghuapian/555/4.html, /donghuapian/555/5.html, /donghuapian/555/6.html, /donghuapian/555/7.html, /donghuapian/555/8.html, /donghuapian/555/9.html, /donghuapian/555/10.html, /donghuapian/555/11.html, /donghuapian/555/12.html, /donghuapian/555/13.html, /donghuapian/555/14.html, /donghuapian/555/15.html, /donghuapian/555/16.html, /donghuapian/555/17.html, /donghuapian/555/18.html, /donghuapian/555/19.html, /donghuapian/555/20.html, /donghuapian/555/21.html, /donghuapian/555/22.html, /donghuapian/555/23.html, /donghuapian/555/24.html, /donghuapian/555/25.html, /donghuapian/555/26.html, /donghuapian/555/27.html, /donghuapian/555/28.html, /donghuapian/555/29.html, /donghuapian/555/30.html, /donghuapian/555/31.html, /donghuapian/555/32.html, /donghuapian/555/33.html, /donghuapian/555/34.html, /donghuapian/555/35.html, /donghuapian/555/36.html, /donghuapian/555/37.html, /donghuapian/555/38.html, /donghuapian/555/39.html, /donghuapian/555/40.html, /donghuapian/555/41.html, /donghuapian/555/42.html, /donghuapian/555/43.html, /donghuapian/555/44.html, /donghuapian/555/45.html, /donghuapian/555/46.html, /donghuapian/555/47.html, /donghuapian/555/48.html, /donghuapian/555/49.html, /donghuapian/555/50.ht