E_D("replace into `phome_ecms_game` values('773','5','0','','','','1','admin','','1','0','1343189704','0','0','0','0','','','773','0','0','0','0','0','0','淘气的金丝猴','1343189704','/spic/20120725/528.jpg','0','1','1343189704','0','3','1','0','','0','','','667','479','《淘气的金丝猴》是一部水墨动画影片，故事讲述了有一只娇生惯养的小金丝猴，它傲慢无礼、任性，谁也不愿和它做朋友。一次它要与小熊猫比赛爬树，小熊猫不是小猴的对手，结果输了，小熊猫老老实实地受罚，在地上翻了两个筋斗，惹得大家笑起来。接着小熊猫提出与小猴比下山坡。','1','','0','','1','/dpic/20120725/529.jpg','353','/donghuapian/353/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/010.jpg','http://www.61baobao.com/donghuapian/pic/05/010.jpg','0','三个月以上','1','cntv,55DE535D2FD84938B94D60D1281C1369|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('774','5','1','','','','1','admin','','1','0','1343189708','0','0','0','0','','','774','0','0','0','0','0','0','三毛从军记','1343189708','/spic/20120725/532.jpg','0','1','1343189708','0','3','1','0','','0','','','667','479',' 讲述的是在战争时期，无家可归的三毛参了军。新兵训练开始，矮小的三毛穿着“巨大”的军服站在队列中，显得十分滑稽。军营的生活让三毛一时不能适应，还有一些人故意捉弄三毛，让三毛闹出了许多笑话。但是，三毛凭借自己的机智、勇敢，努力地在部队中生存了下去。三毛运用自己的优势和智慧，虽然闹了些笑话，出了些洋相，但在紧急关头，却也立了大功，成了很受大家喜爱的小英雄。<br />','1','','0','','1','/dpic/20120725/533.jpg','469','/donghuapian/469/1.html, /donghuapian/469/2.html, /donghuapian/469/3.html, /donghuapian/469/4.html, /donghuapian/469/5.html, /donghuapian/469/6.html, /donghuapian/469/7.html, /donghuapian/469/8.html, /donghuapian/469/9.html, /donghuapian/469/10.html, /donghuapian/469/11.html, /donghuapian/469/12.html, /donghuapian/469/13.html,','1','0','','http://www.61baobao.com/donghuapian/dpic/05/0112.jpg','http://www.61baobao.com/donghuapian/pic/05/0112.jpg','0','三个月以上','13','cntv,84339a93ef32456e8c7d9ba79e3ba691|||cntv,f6c45afc7db648418d698b14ad544617|||cntv,40c9c3d9bebe4b5aaa189ad7ec3b91c7|||cntv,7e2b3990b4384da1a9afbf4de7cb1eee|||cntv,58435aeb4fef448abe284847919153e4|||cntv,ec30cc8641e0459bbf6b6c4f6d87b95c|||cntv,792ab0279aff4a94b41a8b7a00bff41a|||cntv,48621062ee104b4c5a100cb4604841f4|||cntv,a054f525c0a74845fb56a3a8970296b7|||cntv,12f6d8a582dc49e12b932fad9d59c667|||cntv,5b3f31a54cd04593f990aa9edfdd780a|||cntv,8c62e32a10194d4e68e69a83e3c552dc|||cntv,94238d07216a44d211fef6af7279e626|||','0','','0','0','0');");
