E_D("replace into `phome_ecms_game` values('789','5','0','','','','1','admin','','1','0','1343189762','0','0','0','0','','','789','0','0','0','0','0','0','恐龙宝贝之龙神勇士第3季','1343189762','/spic/20120725/578.jpg','0','1','1343189762','0','3','1','0','','0','','','667','479',' 在古老而遥远的泛古大陆，人类与恐龙和谐共处，大陆呈现一片祥和气氛和色彩。但好景不长，随着大陆的守护神“龙神”的力量减弱，以瑞鹰为首的邪恶势力打破了和平与宁静。龙神为了拯救泛古大陆，早已将自己的力量封存在四块龙晶体，传说谁得到这四块龙晶体，就能得到无尚的力量，统治整个泛古大陆。地球少年龙翔无意中碰触爷爷的龙神手镯，穿越时空，来到泛古大陆','1','','0','','1','/dpic/20120725/579.jpg','902','/donghuapian/902/1.html, /donghuapian/902/2.html, /donghuapian/902/3.html, /donghuapian/902/4.html, /donghuapian/902/5.html, /donghuapian/902/6.html, /donghuapian/902/7.html, /donghuapian/902/8.html, /donghuapian/902/9.html, /donghuapian/902/10.html, /donghuapian/902/11.html, /donghuapian/902/12.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/07/103.jpg','http://www.61baobao.com/donghuapian/pic/07/103.jpg','0','三个月以上','12','cntv,807a79e9d74c4f62860cd1e6dbe12eb5|||cntv,85918bbc590f43378d2b75bcf71ab3b0|||cntv,eaed8c1b5062426e80aac82da84b6c80|||cntv,48b53114181a4ad19cf13a846b84b524|||cntv,5b53e902b98e4abbbb1fdce05d64b14a|||cntv,a44194dff4184a7c8767a287138de756|||cntv,d409b217eb0b45da83c9e0c13aa6f920|||cntv,dd432ba9e3964b29babfac9bb19c97f3|||cntv,063a27d34ee74786b72791dcadc8195e|||cntv,f6904ba11ffb488ea72371858cffb7e4|||cntv,0861fc45c15e4252873aa20addae4159|||cntv,11410def5928403e862e6228673f893d|||','0','','0','0','0');");
