E_D("replace into `phome_ecms_game` values('792','5','0','','','','1','admin','','1','0','1343189768','0','0','0','0','','','792','0','0','0','0','0','0','小蝌蚪找妈妈','1343189768','/spic/20120725/588.jpg','0','1','1343189768','0','3','1','0','','0','','','667','479',' 动画短片《小蝌蚪找妈妈》是中国第一部水墨动画片，由绘画大师齐白石执笔绘制美术片。讲述了一群可爱的小蝌蚪出世了，但是，“谁是我们的妈妈呢？”于是，一场有趣而感人的寻亲之旅开始了。告诉我们“有志者事竟成”的道理，也教育孩子们要全面的看问题，不能片面化，也是一部带有科普意味的影片。','1','','0','','1','/dpic/20120725/589.jpg','489','/donghuapian/489/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/0132.jpg','http://www.61baobao.com/donghuapian/pic/05/0132.jpg','0','三个月以上','1','cntv,6CF50752C7604456A031E27F6580BAF9|||','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('793','5','0','','','','1','admin','','1','0','1343189769','0','0','0','0','','','793','0','0','0','0','0','0','刺猬背西瓜','1343189769','/spic/20120725/562.jpg','0','1','1343189769','0','3','1','0','','0','','','667','479','《刺猬背西瓜》是一部彩色剪纸动画片，故事讲述了一只小刺猬正要用手捡了一个红果，妈妈提醒它不许用手捡，要它把红果仍掉，并告诉它，刺猬是用刺背果子的。随后，小刺猬看见一颗红果树，要求妈妈给它刺两个红果吃，妈妈费了很大力气也刺不到。小刺猬问妈妈为什么不能用手去摘？妈妈说：“我妈妈是这样教的，我妈妈的妈妈也是这样教的”.....','1','','0','','1','/dpic/20120725/563.jpg','357','/donghuapian/357/1.html,','0','0','','http://www.61baobao.com/donghuapian/dpic/05/013.jpg','http://www.61baobao.com/donghuapian/pic/05/013.jpg','0','三个月以上','1','cntv,38F62406C4444f889A2C789F3576A338|||','0','','0','0','0');");
